          <text id="An orbit is the curved path that an object in space (such as a star, planet, moon, asteroid or spacecraft) takes around another due to gravity. As the Moon orbits around Earth, so other objects float following specific trajectories:" fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="50" y="2113.9">An orbit is the curved path that an object </tspan><tspan x="50" y="2142.9">in space (such as a star, planet, moon, </tspan><tspan x="50" y="2171.9">asteroid or spacecraft) takes around </tspan><tspan x="50" y="2200.9">another due to gravity. As the Moon orbits </tspan><tspan x="50" y="2229.9">around Earth, so other objects float </tspan><tspan x="50" y="2258.9">following specific trajectories:</tspan></text>

          <g id="LEO (Low Earth Orbit) / 160-2000 km">
          <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="126" y="2523.9">/ </tspan></text>
          <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="143.367" y="2523.9">160-2000 km</tspan></text>
          <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="126" y="2494.9">LEO (Low Earth Orbit) &#10;</tspan></text>
          </g>
          <text id="LEO is densely populated with thousands of operational satellites today, primarily addressing science, imaging, and low-bandwidth telecommunications needs. Elon Musk&#226;&#128;&#153;s Starlink satellite constellation is orbiting at between 400 and 500 km of altitude." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="126" y="2553.1">LEO is densely populated with thousands of </tspan><tspan x="126" y="2572.1">operational satellites today, primarily addressing </tspan><tspan x="126" y="2591.1">science, imaging, and low-bandwidth </tspan><tspan x="126" y="2610.1">telecommunications needs. Elon Musk&#x2019;s Starlink </tspan><tspan x="126" y="2629.1">satellite constellation is orbiting at between 400 </tspan><tspan x="126" y="2648.1">and 500 km of altitude.&#10;</tspan></text>
          <text id="MEO (Medium Earth Orbit) / 2000-35,000 km" fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="126" y="2701.9">MEO (Medium Earth Orbit) &#10;</tspan><tspan x="126" y="2730.9">/ 2000-35,000 km</tspan></text>
          <text id="MEO satellites bring fiber-like performance to remote areas where laying fiber is not viable. Examples of remote locations are cruise commercial maritime ships, aircraft, offshore platforms, isolated terrains, and humanitarian relief operations." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="126" y="2760.1">MEO satellites bring fiber-like performance to </tspan><tspan x="126" y="2779.1">remote areas where laying fiber is not viable. </tspan><tspan x="126" y="2798.1">Examples of remote locations are cruise </tspan><tspan x="126" y="2817.1">commercial maritime ships, aircraft, offshore </tspan><tspan x="126" y="2836.1">platforms, isolated terrains, and humanitarian </tspan><tspan x="126" y="2855.1">relief operations.&#10;</tspan></text>
          <text id="GEO (Geostationary Earth Orbit) / 35,785 km" fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="126" y="2908.9">GEO (Geostationary Earth Orbit) &#10;</tspan><tspan x="126" y="2937.9">/ 35,785 km</tspan></text>
          <text id="GEO satellites are positioned at a specific altitude to match the rotation of the Earth as they travel and to remain above the same point on the ground. Hundreds of GEO satellites are in orbit today, traditionally delivering services such as weather data, broadcast TV, and some low-speed data communication." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="126" y="2967.1">GEO satellites are positioned at a specific altitude </tspan><tspan x="126" y="2986.1">to match the rotation of the Earth as they travel </tspan><tspan x="126" y="3005.1">and to remain above the same point on the ground. </tspan><tspan x="126" y="3024.1">Hundreds of GEO satellites are in orbit today, </tspan><tspan x="126" y="3043.1">traditionally delivering services such as weather </tspan><tspan x="126" y="3062.1">data, broadcast TV, and some low-speed data </tspan><tspan x="126" y="3081.1">communication.&#10;</tspan></text>
          <text id="HEO (High Earth Orbit) / Above 35,785 km" fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="126" y="3134.9">HEO (High Earth Orbit) &#10;</tspan><tspan x="126" y="3163.9">/ Above 35,785 km</tspan></text>
          <text id="HEO refers to a geocentric orbit at an altitude higher than the Geosynchronous range, thus having an orbital period greater than 24 hours. The most well-known object in HEO is our Moon, which takes 27 days to orbit the Earth." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="126" y="3193.1">HEO refers to a geocentric orbit at an altitude higher </tspan><tspan x="126" y="3212.1">than the Geosynchronous range, thus having an </tspan><tspan x="126" y="3231.1">orbital period greater than 24 hours. The most well-</tspan><tspan x="126" y="3250.1">known object in HEO is our Moon, which takes 27 </tspan><tspan x="126" y="3269.1">days to orbit the Earth.&#10;</tspan></text>
          </g>

          <text id="&#226;&#128;&#156;Satellite Charts&#226;&#128;&#157; maps past and current artificial satellites orbiting around Earth, pointing out how our terrestrial life became so dependent on what we sent out in space." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="40" font-weight="500" letter-spacing="0em"><tspan x="50" y="340">&#x201c;Satellite Charts&#x201d; maps </tspan><tspan x="50" y="388">past and current </tspan><tspan x="50" y="436">artificial satellites </tspan><tspan x="50" y="484">orbiting around Earth, </tspan><tspan x="50" y="532">pointing out how our </tspan><tspan x="50" y="580">terrestrial life became so </tspan><tspan x="50" y="628">dependent on what we </tspan><tspan x="50" y="676">sent out in space. </tspan></text>
          <text id="The main visualization is a beeswarm chart showing 11,972 satellites launched between October 4th, 1957, and March 6th, 2022. Satellites are plotted by launch date and apogee (the maximum orbital distance from Earth). The information positioned along the frame gives more context to the history, use, and disposal of space objects." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="50" y="730.9">The main visualization is a beeswarm </tspan><tspan x="50" y="759.9">chart showing 11,972 satellites launched </tspan><tspan x="50" y="788.9">between October 4th, 1957, and March 6th, </tspan><tspan x="50" y="817.9">2022. Satellites are plotted by launch date </tspan><tspan x="50" y="846.9">and apogee (the maximum orbital </tspan><tspan x="50" y="875.9">distance from Earth). The information </tspan><tspan x="50" y="904.9">positioned along the frame gives more </tspan><tspan x="50" y="933.9">context to the history, use, and disposal of </tspan><tspan x="50" y="962.9">space objects.</tspan></text>
          <text id="Since Sputnik, the first satellite launched into Low Earth orbit by the Soviet Union on 4 October 1957, the race to space exploration has grown up steadily. Today, about 100 countries own, control, or co-operate one or more satellites in orbit." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="50" y="1006.1">Since Sputnik, the first satellite launched into Low Earth orbit </tspan><tspan x="50" y="1025.1">by the Soviet Union on 4 October 1957, the race to space </tspan><tspan x="50" y="1044.1">exploration has grown up steadily. Today, about 100 countries </tspan><tspan x="50" y="1063.1">own, control, or co-operate one or more satellites in orbit. </tspan></text>

          <text id="In addition to height, eccentricity and inclination also shape a satellite&#226;&#128;&#153;s orbit. A satellite with a low eccentricity orbit moves in a circle around the Earth. An eccentric orbit is elliptical, with the satellite&#226;&#128;&#153;s distance from Earth changing depending on where it is in its orbit." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="49" y="3351.9">In addition to height, eccentricity and </tspan><tspan x="49" y="3380.9">inclination also shape a satellite&#x2019;s orbit. &#10;</tspan><tspan x="49" y="3409.9">A satellite with a low eccentricity orbit </tspan><tspan x="49" y="3438.9">moves in a circle around the Earth. An </tspan><tspan x="49" y="3467.9">eccentric orbit is elliptical, with the </tspan><tspan x="49" y="3496.9">satellite&#x2019;s distance from Earth changing </tspan><tspan x="49" y="3525.9">depending on where it is in its orbit.</tspan></text>

          <text id="The Committee on Space Research has been identifying every artificial object launched in space with a unique number (COSPAR ID). Since 1957 (until March 6th, 2022), 51,688 space objects have been added to the catalog." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="231" y="1237.9">The Committee on Space </tspan><tspan x="231" y="1266.9">Research has been </tspan><tspan x="231" y="1295.9">identifying every </tspan><tspan x="231" y="1324.9">artificial object launched </tspan><tspan x="231" y="1353.9">in space with a unique </tspan><tspan x="231" y="1382.9">number (COSPAR ID). </tspan><tspan x="231" y="1411.9">Since 1957 (until March </tspan><tspan x="231" y="1440.9">6th, 2022), 51,688 space </tspan><tspan x="231" y="1469.9">objects have been added </tspan><tspan x="231" y="1498.9">to the catalog. </tspan></text>
          <text id="Currently, there are about 25,487 objects orbiting Earth: about 8,168 are payloads (the actual satellites or spacecrafts); all the rest is space debris. Rocket bodies, launch stage components, and collateral damages created from incidents, malfunction issues, or Anti-Satellite tests pollute the space until they burn down when reentering the atmosphere. About 303 objects have not been identified yet (To Be Assigned, TBA)." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="231" y="1542.1">Currently, there are about 25,487 </tspan><tspan x="231" y="1561.1">objects orbiting Earth: about 8,168 are </tspan><tspan x="231" y="1580.1">payloads (the actual satellites or </tspan><tspan x="231" y="1599.1">spacecrafts); all the rest is space </tspan><tspan x="231" y="1618.1">debris. Rocket bodies, launch stage </tspan><tspan x="231" y="1637.1">components, and collateral damages </tspan><tspan x="231" y="1656.1">created from incidents, malfunction </tspan><tspan x="231" y="1675.1">issues, or Anti-Satellite tests pollute </tspan><tspan x="231" y="1694.1">the space until they burn down when </tspan><tspan x="231" y="1713.1">reentering the atmosphere. About </tspan><tspan x="231" y="1732.1">303 objects have not been identified </tspan><tspan x="231" y="1751.1">yet (To Be Assigned, TBA).</tspan></text>
          <text id="Of all the payloads in orbit, 5,095 are registered as operational (or partly operational). There are 1,484 non-operational space objects: satellites have yet to be activated or simply not working because they had a technical malfunction or finished their mission. The remaining 1,589 have an unknown status." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="231" y="1792.1">Of all the payloads in orbit, 5,095 are </tspan><tspan x="231" y="1811.1">registered as operational (or partly </tspan><tspan x="231" y="1830.1">operational). There are 1,484 non-</tspan><tspan x="231" y="1849.1">operational space objects: satellites </tspan><tspan x="231" y="1868.1">have yet to be activated or simply not </tspan><tspan x="231" y="1887.1">working because they had a technical </tspan><tspan x="231" y="1906.1">malfunction or finished their mission. </tspan><tspan x="231" y="1925.1">The remaining 1,589 have an </tspan><tspan x="231" y="1944.1">unknown status.</tspan></text>

          <text id="Every artificial object orbiting Earth is classified as a satellite. Its status depends on the operational services provided and if it is still or no longer in orbit." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="551" y="124.9">Every artificial object orbiting Earth </tspan><tspan x="551" y="153.9">is classified as a satellite. Its status </tspan><tspan x="551" y="182.9">depends on the operational services </tspan><tspan x="551" y="211.9">provided and if it is still or no longer </tspan><tspan x="551" y="240.9">in orbit.</tspan></text>
          <text id="It is not easy identifying which nation owns or controls a satellite. Multiple countries can operate space objects due to international projects or leasing." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="1752" y="123.9">It is not easy identifying which nation </tspan><tspan x="1752" y="152.9">owns or controls a satellite. Multiple </tspan><tspan x="1752" y="181.9">countries can operate space objects due </tspan><tspan x="1752" y="210.9">to international projects or leasing.</tspan></text>
          <text id="Space is a growing field of investment: it is clear how many companies and organizations are interested in owning or controlling a satellite." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="5670" y="124.9">Space is a growing field of investment: </tspan><tspan x="5670" y="153.9">it is clear how many companies and </tspan><tspan x="5670" y="182.9">organizations are interested in owning </tspan><tspan x="5670" y="211.9">or controlling a satellite.</tspan></text>

          <text id="space debris" fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="32" font-weight="500" letter-spacing="0em"><tspan x="9371" y="1465.2">SPACE DEBRIS</tspan></text>
          <text id="Orbital debris is any human-made object in orbit about the Earth that does not function anymore. Such debris includes nonfunctional spacecraft, abandoned launch vehicle stages, mission-related debris, and fragmentation debris." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="9376" y="1518.9">Orbital debris is any human-made object </tspan><tspan x="9376" y="1547.9">in orbit about the Earth that does not </tspan><tspan x="9376" y="1576.9">function anymore. Such debris includes </tspan><tspan x="9376" y="1605.9">nonfunctional spacecraft, abandoned </tspan><tspan x="9376" y="1634.9">launch vehicle stages, mission-related </tspan><tspan x="9376" y="1663.9">debris, and fragmentation debris.</tspan></text>
          <text id="Not portrayed in the chart, the number of orbiting debris was 14,734 as of March 6th, 2022. 18,354 space debris registered were instead already decayed." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="9572" y="1731.1">Not portrayed in the chart, the </tspan><tspan x="9572" y="1750.1">number of orbiting debris was  </tspan><tspan x="9572" y="1769.1">14,734 as of March 6th, 2022. </tspan><tspan x="9572" y="1788.1">18,354 space debris registered </tspan><tspan x="9572" y="1807.1">were instead already decayed.</tspan></text>
          <text id="Most of space debris fly in Low Earth Orbit, which slowsly become an orbital space junkyard. Due to the rate of speed and volume, space debris must be tracked to avoid collisions with other satellites and interfere with space operations, as well as a possible risk to human life on Earth." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="9572" y="1919.1">Most of space debris fly in Low </tspan><tspan x="9572" y="1938.1">Earth Orbit, which slowsly become </tspan><tspan x="9572" y="1957.1">an orbital space junkyard. Due to </tspan><tspan x="9572" y="1976.1">the rate of speed and volume, </tspan><tspan x="9572" y="1995.1">space debris must be tracked to </tspan><tspan x="9572" y="2014.1">avoid collisions with other </tspan><tspan x="9572" y="2033.1">satellites and interfere with space </tspan><tspan x="9572" y="2052.1">operations, as well as a possible </tspan><tspan x="9572" y="2071.1">risk to human life on Earth.</tspan></text>
          <text id="Active Removal" fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="9372" y="2140.9">Active Removal </tspan></text>
          <text id="The European Space Agency has studied how the number of debris objects would continue to grow due to the collision rate, even in a future scenario in which no further objects are launched into space. Technologies and procedures for Active Removal of space debris are currently being studied and tested, with a few already active projects." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="9372" y="2173.1">The European Space Agency has studied how the number of </tspan><tspan x="9372" y="2192.1">debris objects would continue to grow due to the collision </tspan><tspan x="9372" y="2211.1">rate, even in a future scenario in which no further objects are </tspan><tspan x="9372" y="2230.1">launched into space. Technologies and procedures for Active </tspan><tspan x="9372" y="2249.1">Removal of space debris are currently being studied and </tspan><tspan x="9372" y="2268.1">tested, with a few already active projects.</tspan></text>

          <text id="The average satellite lifespan is about 15 years; many continue to operate for longer. What to do then, when they terminate their work?" fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="9370" y="532.9">The average satellite lifespan is about 15 </tspan><tspan x="9370" y="561.9">years; many continue to operate for </tspan><tspan x="9370" y="590.9">longer. What to do then, when they </tspan><tspan x="9370" y="619.9">terminate their work?</tspan></text>
          <text id="Small satellites in Low Earth Orbit can be simply pushed closer to Earth&#226;&#128;&#153;s atmosphere, where they incinerate. Larger satellites cannot follow the same process: they may cause harm to the population if they do not disintegrate correctly. To avoid the risk, retired satellites are often deorbited to a space graveyard or brought down to specific points on Earth." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="9370" y="663.1">Small satellites in Low Earth Orbit can be simply pushed closer </tspan><tspan x="9370" y="682.1">to Earth&#x2019;s atmosphere, where they incinerate. Larger satellites </tspan><tspan x="9370" y="701.1">cannot follow the same process: they may cause harm to the </tspan><tspan x="9370" y="720.1">population if they do not disintegrate correctly. To avoid the risk, </tspan><tspan x="9370" y="739.1">retired satellites are often deorbited to a space graveyard or </tspan><tspan x="9370" y="758.1">brought down to specific points on Earth.</tspan></text>

          <text id="Graveyard Orbit (GEO+300km)" fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="9370" y="825.9">Graveyard Orbit </tspan><tspan x="9370" y="854.9">(GEO+300km)</tspan></text>
          <text id="To eliminate the collision risk, GEO satellites are usually moved out of the geostationary ring at the end of their mission. 300 km is considered a safe distance to avoid future interference with active GEO spacecraft. Satellites have to stop operations three months before terminating the fuel and give up considerable revenue to be de-orbited correctly." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="9370" y="886.1">To eliminate the collision risk, GEO </tspan><tspan x="9370" y="905.1">satellites are usually moved out of </tspan><tspan x="9370" y="924.1">the geostationary ring at the end of </tspan><tspan x="9370" y="943.1">their mission. 300 km is </tspan><tspan x="9370" y="962.1">considered a safe distance to avoid </tspan><tspan x="9370" y="981.1">future interference with active GEO </tspan><tspan x="9370" y="1000.1">spacecraft. Satellites have to stop </tspan><tspan x="9370" y="1019.1">operations three months before </tspan><tspan x="9370" y="1038.1">terminating the fuel and give up </tspan><tspan x="9370" y="1057.1">considerable revenue to be de-</tspan><tspan x="9370" y="1076.1">orbited correctly.&#10;</tspan></text>
          <text id="Point Nemo" fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="9370" y="1131.9">Point Nemo</tspan></text>
          <text id="Point Nemo is about 2,688 kilometers away from the nearest land in the middle of the South Pacific. Also known as Point of Oceanic Inaccessibility, the watery graveyard holds hundreds of decommissioned satellites and space stations. The International Space Station is planned to crash here in 2031." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="9370" y="1163.1">Point Nemo is about 2,688 </tspan><tspan x="9370" y="1182.1">kilometers away from the nearest </tspan><tspan x="9370" y="1201.1">land in the middle of the South </tspan><tspan x="9370" y="1220.1">Pacific. Also known as Point of </tspan><tspan x="9370" y="1239.1">Oceanic Inaccessibility, the watery </tspan><tspan x="9370" y="1258.1">graveyard holds hundreds of </tspan><tspan x="9370" y="1277.1">decommissioned satellites and </tspan><tspan x="9370" y="1296.1">space stations. The International </tspan><tspan x="9370" y="1315.1">Space Station is planned to crash </tspan><tspan x="9370" y="1334.1">here in 2031.</tspan></text>
          </g>
          <text id="ASAT weapons" fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="32" font-weight="500" letter-spacing="0em"><tspan x="9371" y="2390.2">ASAT WEAPONS</tspan></text>
          <text id="SOURCES" fill="#BDBDBD" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="9371" y="3273.9">SOURCES</tspan></text>
          <text id="Although no ASAT system has yet been utilized in warfare, countries like Russia, the United States, China, and India have successfully shot down their own satellites to demonstrate their ASAT capabilities. ASATs have also been used to remove decommissioned satellites. Besides accidental break-ups, satellite interceptions by surface-launched missiles have been a major contributor to space debris in the recent past." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="9371" y="2774.1">Although no ASAT system has yet been utilized in warfare, </tspan><tspan x="9371" y="2793.1">countries like Russia, the United States, China, and India have </tspan><tspan x="9371" y="2812.1">successfully shot down their own satellites to demonstrate </tspan><tspan x="9371" y="2831.1">their ASAT capabilities. ASATs have also been used to remove </tspan><tspan x="9371" y="2850.1">decommissioned satellites. &#10;</tspan><tspan x="9371" y="2869.1">&#10;</tspan><tspan x="9371" y="2888.1">Besides accidental break-ups, satellite interceptions by </tspan><tspan x="9371" y="2907.1">surface-launched missiles have been a major contributor to </tspan><tspan x="9371" y="2926.1">space debris in the recent past. </tspan></text>
          <text id="Anti-satellite weapons&#194;&#160;(ASAT) are&#194;&#160;space weapons&#194;&#160;designed to incapacitate or destroy&#194;&#160;satellites&#194;&#160;for&#194;&#160;strategic&#194;&#160;or&#194;&#160;tactical&#194;&#160;purposes. Several nations possess operational ASAT systems." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="24" letter-spacing="0em"><tspan x="9371" y="2439.9">Anti-satellite weapons&#xa0;(ASAT) are&#xa0;space </tspan><tspan x="9371" y="2468.9">weapons&#xa0;designed to incapacitate or </tspan><tspan x="9371" y="2497.9">destroy&#xa0;satellites&#xa0;for&#xa0;strategic&#xa0;or&#xa0;tactical&#xa0;</tspan><tspan x="9371" y="2526.9">purposes. Several nations possess </tspan><tspan x="9371" y="2555.9">operational ASAT systems. </tspan></text>

          <text id="A striking example is the recent Russian ASAT test of November 15th, 2021. The country shot at a defunct Soviet satellite (Cosmos 1408) that hasn&#39;t functioned since the 1980s. The impact threatened the lives of the astronauts present on the International Space Station and caused about 1,561 debris. Only 8.7% has decayed as of March 6th, 2022." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="14" letter-spacing="0em"><tspan x="9572" y="3009.4">A striking example is the recent </tspan><tspan x="9572" y="3026.4">Russian ASAT test of November 15th, </tspan><tspan x="9572" y="3043.4">2021. The country shot at a defunct </tspan><tspan x="9572" y="3060.4">Soviet satellite (Cosmos 1408) that </tspan><tspan x="9572" y="3077.4">hasn&#39;t functioned since the 1980s. The </tspan><tspan x="9572" y="3094.4">impact threatened the lives of the </tspan><tspan x="9572" y="3111.4">astronauts present on the International </tspan><tspan x="9572" y="3128.4">Space Station and caused about 1,561 </tspan><tspan x="9572" y="3145.4">debris. Only 8.7% has decayed as of </tspan><tspan x="9572" y="3162.4">March 6th, 2022.</tspan></text>

          <text id="**Ukraine mainly produced Earth observation satellites and CubeSats in cooperation with Russia and other countries of the CIS organization. Out of the seven satellites listed, only one was operational at the beginning of the Russian invasion. Ukraine benefitted from Elon Musk&#226;&#128;&#153;s Starlink satellites and US intelligence forces to keep the communication services running in the country and among the troops." fill="#828282" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="12" font-weight="500" letter-spacing="0em"><tspan x="5398" y="92.7">**Ukraine mainly produced  Earth </tspan><tspan x="5398" y="105.7">observation satellites and  CubeSats </tspan><tspan x="5398" y="118.7">in cooperation with Russia and other </tspan><tspan x="5398" y="131.7">countries of the CIS organization. </tspan><tspan x="5398" y="144.7">Out of the seven satellites listed, </tspan><tspan x="5398" y="157.7">only one was operational at the </tspan><tspan x="5398" y="170.7">beginning of the Russian invasion. </tspan><tspan x="5398" y="183.7">Ukraine benefitted from Elon Musk&#x2019;s </tspan><tspan x="5398" y="196.7">Starlink satellites and US </tspan><tspan x="5398" y="209.7">intelligence forces to keep the </tspan><tspan x="5398" y="222.7">communication services running in </tspan><tspan x="5398" y="235.7">the country and among the troops. </tspan></text>
          <text id="Assigning a unique category to each satellite is not an easy task. Satellites can have multiple purposes like space exploration and experimenting with new technologies, and be employed for civilian and military use." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="981" y="3497.1">Assigning a unique category to each </tspan><tspan x="981" y="3516.1">satellite is not an easy task. Satellites </tspan><tspan x="981" y="3535.1">can have multiple purposes like space </tspan><tspan x="981" y="3554.1">exploration and experimenting with </tspan><tspan x="981" y="3573.1">new technologies, and be employed for </tspan><tspan x="981" y="3592.1">civilian and military use. </tspan></text>
          <text id="This pie chart visualization has been designed by assembling multiple sources and databases. Therefore, it is not flawless or complete." fill="#BDBDBD" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="12" font-weight="500" letter-spacing="0em"><tspan x="1276" y="3620.7">This pie chart visualization has been designed by </tspan><tspan x="1276" y="3633.7">assembling multiple sources and databases. </tspan><tspan x="1276" y="3646.7">Therefore, it is not flawless or complete.</tspan></text>
          <text id="Earth Observation satellites are intended for non-military uses such as environmental monitoring, meteorology, and cartography. They can vary according to the type of orbit, payload, spatial resolution, and sensors" fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="1610" y="3496.1">Earth Observation satellites are </tspan><tspan x="1610" y="3515.1">intended for non-military uses such as </tspan><tspan x="1610" y="3534.1">environmental monitoring, </tspan><tspan x="1610" y="3553.1">meteorology, and cartography. They can </tspan><tspan x="1610" y="3572.1">vary according to the type of orbit,  </tspan><tspan x="1610" y="3591.1">payload, spatial resolution, and sensors</tspan></text>

          <text id="Communication satellites are used for television, telephone, radio, internet, and military applications. Most communications satellites are in geostationary orbit so that satellite dish antennas of ground stations do not have to move to track the satellite." fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="16" letter-spacing="0em"><tspan x="3420" y="3497.1">Communication satellites are used for </tspan><tspan x="3420" y="3516.1">television, telephone, radio, internet, and </tspan><tspan x="3420" y="3535.1">military applications. Most </tspan><tspan x="3420" y="3554.1">communications satellites are in </tspan><tspan x="3420" y="3573.1">geostationary orbit so that satellite dish </tspan><tspan x="3420" y="3592.1">antennas of ground stations do not have </tspan><tspan x="3420" y="3611.1">to move to track the satellite.</tspan></text>
          <g id="Earth resource satellites monitor Earth&#39;s oceans, ice caps, and coastal regions. They provide global measurements of wind speed and direction, wave height, surface temperature, cloud cover, etc.">
          <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="14" letter-spacing="0em"><tspan x="2037.21" y="3442.4">satellites monitor Earth&#39;s </tspan><tspan x="1935" y="3459.4">oceans, ice caps, and coastal regions. </tspan><tspan x="1935" y="3476.4">They provide global measurements of </tspan><tspan x="1935" y="3493.4">wind speed and direction, wave height, </tspan><tspan x="1935" y="3510.4">surface temperature, cloud cover, etc.</tspan></text>
          <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="14" font-weight="800" letter-spacing="0em"><tspan x="1935" y="3442.4">Earth resource </tspan></text>
          </g>
          <g id="Search and rescue satellites are designed to provide a way for vessels at sea and in the air to communicate from remote areas. These satellites can locate emergency beacons carried by ships, aircrafts, or individuals in remote places.">
          <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="14" letter-spacing="0em"><tspan x="2057.08" y="3556.4"> satellites are </tspan><tspan x="1935" y="3573.4">designed to provide a way for vessels at </tspan><tspan x="1935" y="3590.4">sea and in the air to communicate from </tspan><tspan x="1935" y="3607.4">remote areas. These satellites can locate </tspan><tspan x="1935" y="3624.4">emergency beacons carried by ships, </tspan><tspan x="1935" y="3641.4">aircrafts, or individuals in remote places.</tspan></text>

          <g id="OPS 3762 (21 Dec 1964 - 11 Jan 1965) OPS 3762, also known as FTV-2355, was an American reconnaissance satellite launched in 1964. Its mission was to demonstrate radar imaging techniques for future missions. OPS was the initial designation for US military satellites, then replaced with the USA.">
          <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="14" letter-spacing="0em"><tspan x="1914.66" y="3058.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1964-087A"> (21 Dec 1964 - 11 Jan 1965)&#10;</a></tspan><tspan x="1852" y="3075.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1964-087A">OPS 3762, also known as FTV-2355, was an American </a></tspan><tspan x="1852" y="3092.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1964-087A">reconnaissance satellite launched in 1964. Its mission </a></tspan><tspan x="1852" y="3109.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1964-087A">was to demonstrate radar imaging techniques for </a></tspan><tspan x="1852" y="3126.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1964-087A">future missions. OPS was the initial designation for </a></tspan><tspan x="1852" y="3143.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1964-087A">US military satellites, then replaced with the USA.</a></tspan></text>
          <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="14" font-weight="800" letter-spacing="0em"><tspan x="1852" y="3058.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1964-087A">OPS 3762</a></tspan></text>

          <g id="GEMINI 1 (08 Apr 1964 - 12 Apr 1964) Gemini 1 was the first mission in NASA&#39;s Gemini program. It consisted of an uncrewed test flight to test the structural integrity of the new spacecraft and launch vehicle and the bespoke tracking and communication systems.">
          <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="14" letter-spacing="0em"><tspan x="1506.07" y="3059.4"><a href="https://historicspacecraft.com/Gemini_Capsules.html"> (08 Apr 1964 - 12 Apr 1964)&#10;</a></tspan><tspan x="1446" y="3076.4"><a href="https://historicspacecraft.com/Gemini_Capsules.html">Gemini 1 was the first mission in NASA&#39;s Gemini </a></tspan><tspan x="1446" y="3093.4"><a href="https://historicspacecraft.com/Gemini_Capsules.html">program. It consisted of an uncrewed test flight to </a></tspan><tspan x="1446" y="3110.4"><a href="https://historicspacecraft.com/Gemini_Capsules.html">test the structural integrity of the new spacecraft </a></tspan><tspan x="1446" y="3127.4"><a href="https://historicspacecraft.com/Gemini_Capsules.html">and launch vehicle and the bespoke tracking and </a></tspan><tspan x="1446" y="3144.4"><a href="https://historicspacecraft.com/Gemini_Capsules.html">communication systems.</a></tspan></text>

          <g id="GORIZONT 1 (19 Dec 1978 - ) Gorizont is a series of 35 Russian geosynchronous communications satellites launched between 1978 and 2000. The Russian Soviet Federative Socialist Republic initiated the program to develop a satellite system to relay coverage of the 1980 Olympic Games from Moscow.">

          <g id="INMARSAT 3-F1 (03 Apr 1996 - ) Inmarsat is a British satellite telecommunications company offering global mobile services. In March 2014, Malaysia Airlines Flight 370 disappeared with 239 passengers and crew en route from Kuala Lumpur to Beijing. Analysis by Inmarsat determined that the aircraft flew into the southern Indian Ocean and was used to guide the search for it.">

          <g id="NOAA 1 (11 Dec 1970 - ) NOAA-1 was a weather satellite operated by the National Oceanic and Atmospheric Administration (NOAA). It was the first polar-orbiting environmental satellite (POES) for long-term forecasting. The satellites carry search and rescue instruments and have helped save the lives of about 10,000 people to date.">

          <g id="STRELA 3M-1 (21 Dec 2005 - ) The Strela 3M (or COSMOS 2416) belongs to a constellation of Russian communications satellites operating in low Earth orbit. The satellites can transmit encrypted messages and images: they remember the received messages and then resend them after a scheduled time or by a command from the Earth.">

          <g id="ONEWEB-0006 (27 Feb 2019 - ) The OneWeb satellite constellation is a planned initial 648-satellite constellation intending to provide global satellite Internet broadband services to people everywhere. OneWeb&#39;s first six satellites were launched in February 2019: the constellation is in the process of being completed.">

          <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="14" letter-spacing="0em"><tspan x="1169" y="1770.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1958-002B"> (17 Mar 1958 - )&#10;</a></tspan><tspan x="1084" y="1787.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1958-002B">Vanguard 1 is an American satellite designed to test </a></tspan><tspan x="1084" y="1804.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1958-002B">launch capabilities and the effects of the space </a></tspan><tspan x="1084" y="1821.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1958-002B">environment on a satellite. Although communications </a></tspan><tspan x="1084" y="1838.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1958-002B">with the satellite got lost in 1964, it remains the </a></tspan><tspan x="1084" y="1855.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1958-002B">oldest human-made object still in orbit, together with </a></tspan><tspan x="1084" y="1872.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1958-002B">the upper stage of its launch vehicle</a></tspan></text>

          <g id="TELSTAR 1 (10 Jul 1962 - ) Telstar 1 was a NASA satellite that allowed the first live broadcast of television images between the US and Europe. It remained active for only seven months before it prematurely failed due to Starfish Prime, a high-altitude nuclear test conducted by the United States. Although it no longer works, it is still in Earth&#39;s orbit.">

          <g id="MOLNIYA 1-3 (25 Apr 1966 - 11 Jun 1973) The Molniya series was a military communications satellite system used by the Soviet Union suited for communications purposes in polar regions. The Molniya 1 took the first images of the whole Earth in history.">

          <g id="LAGEOS 1 (04 May 1976 - ) LAGEOS (Laser Geodynamics Satellite) is a series of two scientific research satellites designed to provide accurate measurements of the satellite&#39;s position to Earth, the planet&#39;s shape (geoid), and its tectonic plate movements associated with continental drift.">

          <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="14" font-weight="800" letter-spacing="0em"><tspan x="3373" y="1656.4"><a href="https://lageos.gsfc.nasa.gov">LAGEOS 1 </a></tspan></text>

          <g id="SPUTNIK 1 (04 Oct 1957-03 Jan 1958) Sputnik 1 was the first artificial Earth satellite. It was launched into an elliptical low Earth orbit by the Soviet Union. It orbited for three weeks before its batteries ran out and fell back into the atmosphere a few months later.">
          <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Supreme" font-size="14" letter-spacing="0em"><tspan x="1148.08" y="3019.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1957-001B"> (04 Oct 1957-03 Jan 1958)&#10;</a></tspan><tspan x="1079" y="3036.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1957-001B">Sputnik 1 was the first artificial Earth satellite. </a></tspan><tspan x="1079" y="3053.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1957-001B">It was launched into an elliptical low Earth </a></tspan><tspan x="1079" y="3070.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1957-001B">orbit by the Soviet Union. It orbited for three </a></tspan><tspan x="1079" y="3087.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1957-001B">weeks before its batteries ran out and fell </a></tspan><tspan x="1079" y="3104.4"><a href="https://nssdc.gsfc.nasa.gov/nmc/spacecraft/display.action?id=1957-001B">back into the atmosphere a few months later.</a></tspan></text>

          <g id="TRAAC (15 Nov 1961 - ) The Transit Research And Attitude Control (TRAAC) satellite was launched by the US Navy. It was used to test the feasibility of using the Earth&#39;s gravitational attraction to orient and stabilize a vehicle in space. TRAAC played a key role in monitoring the Starfish Prime space-based nuclear test.">

          <g id="TRANSIT 1B (13 Apr 1960 - 05 Oct 1967) Navy Transit 1B was the first experimental orbital navigation satellite. Transit spacecraft were developed for updating the inertial navigation systems on board US Navy Polaris submarines and later for civilian use. Transit used a constellation of five satellites and could provide a navigational fix approximately once per hour.">

          <g id="SOYUZ 1 (23 Apr 1967 - 24 Apr 1967 ) Launched into orbit on April 23rd, 1967, carrying cosmonaut colonel Vladimir Komarov, Soyuz 1 was the first crewed flight of the Soviet Soyuz spacecraft. The flight had several technical issues; Komarov lost his life when the descent module crashed into the ground due to a parachute failure. It was the first in-flight fatality in the history of spaceflight.">

          <g id="SKYLAB 1 (14 May 1973 - 11 Jul 1969 ) Skylab was the first United States space station launched by NASA, occupied for about 24 weeks. Unable to be re-boosted by the Space Shuttle, which was not ready until 1981, Skylab&#39;s orbit decayed and disintegrated in the atmosphere scattering debris across the Indian Ocean and Western Australia.">

          <g id="HST (24 Apr 1990 - ) The Hubble Space Telescope is one of the largest and most versatile space telescope launched into low Earth orbit. HST was designed to be modular so that on subsequent shuttle missions it could be recovered, have faulty or obsolete parts replaced.">
